import React, { Component } from 'react';
// import MyGallery from '../PicGallery';
import ImageGallery from 'react-image-gallery';
// import AwesomeSlider from 'react-awesome-slider';
// import AwsSliderStyles from 'react-awesome-slider/src/styles.scss';

// import '../../node_modules/react-awesome-slider/dist/styles.css';
import { withCookies } from 'react-cookie';
import "../../node_modules/react-image-gallery/styles/css/image-gallery.css";
const { User } = require('../matcha_pb');
const { imageRequest } = require('../matcha_pb');

class MyPage extends Component {
	constructor(props) {
		super(props);

		this.state = {
			username: 'username',
			firstName: 'First Name',
			lastName: 'Last Name',
			gender: 'Gender',
			preference: 'Interested in',
			interests: [],
			bio: 'Bio',
			age: 20,
			pics: [],
			fameRating: 50,
			location: 'Location',
			seenHistory: [],
			data: [],
			images: [{
				original: '',
				thumbnail: ''
			}]
		}
	}

	componentDidMount() {
		this.getUserInfo();
		this.allSet();
	}

	getUserInfo = () => {
		const uid = this.props.cookies.get('uid');
		const temp = this.props.cookies.get('session_id');
		const request = new User();
		request.setId(uid);
		let metadata = {
			'user_id': uid,
			'session_id': temp
		}
		window.Aclient.getUser(request, metadata, (err, reply) => {
			if (err) {
				console.log(err.code);
				console.log(err.message);
			} else {
				this.setState({
					username: reply.getUsername(),
					firstName: reply.getFirstname(),
					lastName: reply.getLastname(),
					gender: reply.getGender(),
					preference: reply.getPreference(),
					age: reply.getAge(),
					fameRating: reply.getFamerating(),
					location: reply.getLocation(),
					interests: reply.getTagsList(),
					bio: reply.getBio(),
					seenHistory: reply.getSeenhistoryList()
				});
			}
		})
	}

	getImages = () => {
		return new Promise((resolve, reject) => {
			const request = new imageRequest();
			let arr = [];
			const uid = this.props.cookies.get('uid');
			const session_id = this.props.cookies.get('session_id');
			const metaData = {
				'user_id': uid,
				'session_id': session_id
			}
			request.setUserid(uid);
			request.setAll(true);
			const stream = window.Aclient.getImages(request, metaData);
			stream.on('data', function(response) {
				const d = response.getImage_asB64();
				arr.push(d);
			});
			stream.on('error', function(err) {
				console.log(`error: ${err}`);
			});
			stream.on('end', function(){
				resolve(arr);
			})
		})
	}

	allSet = async () => {
		try {
			const data = await this.getImages();
			this.setState({data});
		} catch(error) {
			console.log(error.response);
		}
	}

	render() {
		const images = this.state.data;
		const Example =  ({ data }) => <img src={`data:image/jpeg;base64,${data}`} alt='' />
		this.setState({ images: { ...this.state.images, original: `data:image/jpeg;base64,${images[1]}`} });

		// const Example2 = ({ data }) => <div data-src={`data:image/jpeg;base64,${data}`} alt="" />
		// let tempArr = {...this.state.images};
		// tempArr.original = "data:image/jpeg;base64," + images[1];
		// tempArr[1].original = "data:image/jpeg;base64," + images[2];
		// this.setState({ images: tempArr});
		// console.log("tempArr is ", tempArr);

		return (
			<div>
				<div>
					<ImageGallery items={this.state.images[0]} />
				</div>
				<div>
					<div>{this.state.username}</div>
					<div>{this.state.firstName}</div>
					<div>{this.state.lastName}</div>
					<div>{this.state.gender}</div>
					<div>{this.state.preference}</div>
					<div>{this.state.age}</div>
					<div>{this.state.fameRating}</div>
					<div>{this.state.location}</div>
					<div>{this.state.interests.map((value, i) => {
						return <span key={i}>{value} </span>
					})}</div>
					<div>{this.state.bio}</div>
					<div>{this.state.seenHistory.map((value, i) => {
						return <span key={i}>{value} </span>
					})}</div>
					<div>
						{images.map((image, key) => <Example data={image} key={key}/>)}
					</div>
				</div>
			</div>
		)
	}
}

export default withCookies(MyPage);
